import React from 'react';
import ReactDropzone from "react-dropzone";

class MultiFileUpload extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      files: [],
    }
  }

  render() {
    return (
      <div className="app">
        <ReactDropzone
          onDrop={this.onDrop}
        >
          Drop your best gator GIFs here!!
        </ReactDropzone>
      </div>
    );
  }
}

export default MultiFileUpload;
